var elementName = "active", leftSide = "{[", rightSide = "]}";
var active_functionName = "", active_return = "active_return_" + v.uid(16);

function active_replaceTxt(textData) {
    var htmls = {
        "&lt;": "<",
        "&gt;": ">"
    };
    var stringData = textData;
    vObject.forKeys(htmls, function(key,value) {
        var checker = new RegExp(key,"gi");
        stringData = stringData.replace(checker,value);
    });
    return stringData;
};

function activeSafeVar(variable) {
  if (vObject.is(variable).string) {
    var valCount = 0, lastVal = "", cd = variable.split("");
    cd.forEach(function(value,index) {     
        if (value === lastVal && value == '\\') { delete cd[index] };
        lastVal = value;
    });
    variable = cd.join("");    
    if (variable) {
        variable = variable.replace(/\\"/ig,'\"')
        .replace(/\'/ig,"\'").replace(/"/ig,'\\"')
        .replace(/\[\[/ig,'\\[\\[').replace(/\]\]/ig,'\\]\\]')
        .replace(/\{\{/ig,'\\{\\{').replace(/\}\}/ig,'\\}\\}')
        .replace(/\+/ig,"\\+").replace(/\=/ig,"\\=")
        .replace(/\;/ig,"\\;");
    };
  };
  return variable;
};

function active_construct(element) { return (element.innerHTML); };
function insertAfter(referenceNode, newNode) { referenceNode.parentNode.insertBefore(newNode, referenceNode.nextSibling); };

function active_parse(stringData, element, self){
    active_functionName = "xio_active_sub" + vObject.uid(10);
    var newFunct = "function " + active_functionName + "() { var "+active_return+" = \"\";";
    if (element && !vObject.is(element).element && vObject.is(element).object) {
        vObject.forKeys(element,function(key,data) {
          if (data) {
            if (vObject.is(data).string) {
                newFunct += "var " + key + " = \"" + activeSafeVar(data) + "\";"
            } else if (vObject.is(data).array) {
                var bString = "["; 
                data.forEach(function(arrayData, arrayIndex) {
                    if (arrayIndex > 0) { bString += "," };
                    if (vObject.is(arrayData).string) {
                        bString += '"' + activeSafeVar(arrayData) + '"';
                    };
                }); bString += "]";
                newFunct += "var " + key + " = " + bString + ";";
            } else if (vObject.is(data).object) {
                newFunct += "var " + key + " = " + JSON.stringify(activeSafeVar(data)) + ";";
            } else {
                newFunct += "var " + key + " = " + activeSafeVar(data) + ";";
            };
          };  
        });
    };
    var splits = String(stringData).split(leftSide), outs = [];
    splits.forEach(function(data,index) {
        var ts = String(data).split(rightSide);
        ts.forEach(function (tData,tIndex) {
            tData = tData.trim();
            if (ts.length > 1 && tIndex == 0) { 
                if (tData.trim() == "}" || tData.trim() == "})") {
                    tData = tData + ";";
                };
                v.forKeys(element,(k,d) => { 
                    tData = tData.replace(new RegExp("{{"+k+"}}","ig"),d) 
                });
                newFunct += active_replaceTxt(tData+";");
            } else {
                tData = tData.replace(/\n|\r/ig," ").replace(/"/ig,'\\"');
                tData = tData.replace(/{{/ig,'"; try { '+active_return+' += ')
                             .replace(/}}/ig,'; } catch(e) { }; '+active_return+' += "');
                if (tData) { newFunct += active_return+' += "' +  tData + '";'; };
            };
        });
    });
    newFunct += "return "+active_return+";};"; 
    eval(newFunct);
    if (element && vObject.is(element).element) {
        if (self) {
            element.innerHTML = eval(active_functionName+"()");
        } else {
            var newEl = document.createElement("span");
            newEl.innerHTML = eval(active_functionName+"()");
            insertAfter(element, newEl);
            element.innerHTML = "";
        };
    } else if (self && (element && vObject.is(element).object)) {
        //console.log("out");
        return eval(active_functionName+"()");
    };
    return newFunct;
};

function active_activate(element,self) {
    active_parse(active_construct(element),element,self);
};


vObject.attach(window,{
    load: function(e) {
        var els = document.getElementsByTagName(elementName);
        if (els.length > 0) {
            vObject.forEach(els,function(el) {            
                active_activate(el);
            });
        };
        var alsoels = document.querySelectorAll('[active]');
        if (alsoels.length >0) {
            vObject.forEach(alsoels,function(el) {
                active_activate(el,true);
            });
        };
    }
});



