vObject.act = function(passObject) {
    var pingObject = {}, addOutput = false;
    if (passObject.file) { 
        pingObject.url = passObject.file + "?v=" +vObject.uid(7)
    } else { 
        console.log("act failed :: no file specified."); 
    };
    if (passObject.done && vObject.is(passObject.done).function) {
        pingObject.done = function(response) {
        
            if (passObject.args && vObject.is(passObject.args).object) {
                eval(active_parse(response,passObject.args));
            } else {
                eval(active_parse(response));
            };
            var outString = eval(active_functionName+"()");
            passObject.done(outString);
            eval(active_functionName + " = undefined;");
        };
    } else if (passObject.elementID && vObject.is(passObject.elementID).string) {
        pingObject.done = function(response) {
            if (passObject.args && vObject.is(passObject.args).object) {
                eval(active_parse(response,passObject.args));
            } else {
                eval(active_parse(response));
            };
            var outString = eval(active_functionName+"()");
            vObject.html("#"+passObject.elementID, outString);
            eval(active_functionName + " = undefined;");
        };        
    };
    vObject.ping(pingObject);
};

function active(fileName,outElement,args) {
    var actObject = { file: fileName, elementID: outElement };
    if (args) { actObject.args = args; };
    v.act(actObject);
};


