/* updated xml parser to include & */
function xio_restring(stringData) {
    return String(stringData).replace(/\{\{prog_and\}\}/ig,"&");
};

/* updated ping for xml fix */
vObject.ping = function(filename) {
    var paramsstring = "";
    var xhttp1 = new XMLHttpRequest();
    if (vObject.is(filename).string) {
        xhttp1.open("GET", filename, false);
        xhttp1.send();
        return xhttp1.responseText;
    } else if (vObject.is(filename).object) {
        if (filename.params) {
            if (vObject.is(filename.params).object) {
                var pstring = "";
                vObject.forKeys(filename.params,function(key,value,index) {
                    pstring += key.toString() + "=" + value + "&";
                });
                paramsstring = pstring;
                if (filename.action.toUpperCase().trim() == "POST") {
                } else {
                    filename.url += "?" + pstring;
                };
            } else if (vObject.is(filename.params).string) {
                paramsstring = filename.params;
                filename.url += "?" + filename.params;
            };
        }
        if (filename.action) { } else { filename.action = "GET" };
        if (filename.type) { } else { filename.type = filename.url.split(".")[1].split("?")[0].trim() };
      xhttp1.onreadystatechange = function() {
        /*console.log(this.readyState + "--" + this.status);*/
          if (this.readyState === 4) {
             if (this.status > 199 && this.status < 300) { if (filename.done) {
                  if (vObject.is(filename.done).function) { 
                    switch (filename.type.toLowerCase().trim()) {
                        case "xml":
                          tText = this.responseText.replace(/\&/ig,"{{prog_and}}");
                          var xml_data = xio_xml_load(tText);
                          if (xml_data == "invalid") {
                            if(filename.error) { if (vObject.is(filename.error).function) { 
                                filename.error("invalid xml") } 
                            };
                          } else {
                            filename.done(xml_data,filename.type);
                          };
                        break;
                        case "json":
                            filename.done(JSON.parse(this.responseText))
                        break;
                        default:
                            filename.done(this.responseText) 
                    };
                  };
                };
             } else { if (filename.error){
                if (vObject.is(filename.error).function) { filename.error(this.status) } };
             };
          }; 
      };
      if (filename.async === false) { } else { filename.async = true };
      xhttp1.open(filename.action.toUpperCase().trim(), filename.url.trim(), filename.async);
      if (filename.action.toUpperCase().trim() == "POST") {
        xhttp1.setRequestHeader("Content-type", "application/x-www-form-urlencoded");
      };
      xhttp1.send(paramsstring); 
    };
};

/* vWip active body load */
/* view: .act, args: .json */

vObject.wip = (info) => {
    vObject.attach(window, { 
      load: () => { if (vObject.is(info.view) && vObject.is(info.args)) {
          if (!vObject.is(info.into)) { info.into = document.body.id };
          vObject.ping({ 
              url: info.args + ".json?v=" + vObject.uid(21),
              type: "JSON", 
              done: profileSet => {
                t = {}; fArgs = Object.assign(t,profileSet);
                profileSet.fullArgs = t;
                  vObject.act({ 
                      file: info.view + ".act?v="+v.uid(30), 
                      args: profileSet, done: response => {
                          if (vObject.is(response)) {
                            vObject.html("#"+info.into,response);
                            if (vObject.is(info.done) && vObject.is(info.done).function) {
                              info.layout = profileSet.layout;
                              info.done(info,profileSet);
                            };
                          };
                      }
                  });
              }, error: res => {
                  if (vObject.is(info.errors) && vObject.is(info.errors).object) {
                      if (vObject.is(info.errors.args) && vObject.is(info.errors.args).function) {
                          info.errors.args(res);
                      };
                  };
              }
          });
      } else {
          if (vObject.is(errors.init) && vObject.is(errors.init).function) {
              errors.init(info);
          };
      };}
    });
  };

  /* date */
  v.date = (dateString) => {
    let xDate = String(Date());
    if (dateString) { xDate = dateString };
    
    xNow =xDate.split("(")[0].split(" "),
    xObj = {
        ux: Date.now(),
        now: xDate,
        weekday: xNow[0],
        month: xNow[1],
        day: xNow[2],
        year: xNow[3],
        hour: String(xNow[4]).split(":")[0],
        minute: String(xNow[4]).split(":")[1],
        second: String(xNow[4]).split(":")[2],
        timezone: String(xNow[5]),
        location: xDate.split("(")[1].split(")")[0]
    };
    return xObj;
};